import React, {Component} from 'react';
import axios from "axios";



class Beers extends Component{
  componentWillMount() {
    axios.get('https://ironbeer-api.herokuapp.com/beers/all')
      .then(res=>{
        console.log(res)
      })

      .catch(err=>{
        console.log(err)
      })
  }

  render() {
    return(
      <div>
        <h1>beer</h1>
      </div>
    )
  }
}


export default Beers
